import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading';
import Para from './Para';
import List from './List';

function App()
{
    return(
        <>
        <Heading/>
        <Para/>
        <List/>
        </>
    )
}
export default App;
